import WorkDay from './WorkDay'
import React, {Component} from 'react';

 const DiaryList = ({workingDiaries,timePeriodList,handleDeleteWorkingDay, handleDeleteWorkingPiece, handleAddWorkingPiece}) => {
        return (
            <div className="row diary-list">
                {workingDiaries.map((workingDiary) => (
                    <WorkDay
                        key = {workingDiary.id}
                        id = {workingDiary.id}
                        header = {workingDiary.header}
                        date =  {workingDiary.date}
                        handleDeleteWorkingDay = {handleDeleteWorkingDay}
                        timePeriodList = {timePeriodList}
                        handleDeleteWorkingPiece = {handleDeleteWorkingPiece}
                        handleAddWorkingPiece = {handleAddWorkingPiece}
                    />
                ))}

            </div>
            )


}

export default DiaryList;
